(function execute(inputs, outputs) {
// ... code ...
     if (inputs.AOwner) 
     {
        var vales = inputs.AOwner;
        var Auser_id = '';
        var sys = [];
        var Auser_id1;
        var values = vales;
    /*   
       if(vales.next() != false)
       {
         // Multiple records
         while(vales.next())
         {
            var idv = vales.user_name.getDisplayValue();
         	Auser_id += '"' + idv + '"' + ',';
           gs.info('while');
          }
         gs.info('if');
       }
       else
       {
         var idv = vales.user_name.getDisplayValue();
         Auser_id += '"' + idv + '"';
         gs.info('else');
       }
       */
      do
      {
	      var idv = vales.user_name.getDisplayValue();
          Auser_id += '"' + idv + '"' + ',';
       }while(vales.next())
       var user = Auser_id.trim().replace(/,{1,}$/, '');
       gs.info('user' +user);
       var ret = user.replace('"",','');

	   //var n = 3;
	   //var users = user.substring(n);
     }
     else 
     {
       //outputs.readaccstatus = 'notdefine';
       gs.info('not define' + Auser_id);
     }
  gs.info('Auser_id' + ret);
})(inputs, outputs);

